import React, { useState, useEffect } from 'react';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';
import { params } from './params'; // Assuming params is correctly imported

export default function FullParameterList({ param_type }) {
    const [keyValuePairs, setKeyValuePairs] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        setLoading(true); // Set loading to true each time param_type changes

        if (param_type === 'standard') {
            const data = params.getStandardParams();
            const transformedData = Object.keys(data[0]).map(key => ({
                key: key,
                value: data[0][key]
            }));
            setKeyValuePairs(transformedData);
            setLoading(false);
        } else if (param_type === 'advanced') {
            console.log('Fetching advanced params...');
            // Example: simulate empty data for now
            setKeyValuePairs([]);
            setLoading(false);
        } else if (param_type === 'full') {
            const data = params.getFullParams();
            // Directly use the data as it's already in the expected format
            setKeyValuePairs(data);
            setLoading(false);
        }
    }, [param_type]);

    return (
        <div className="card">
            {loading ? (
                <p>Loading data...</p> // Add a loading message
            ) : keyValuePairs.length === 0 ? (
                <p>No data available.</p> // Handle empty data case
            ) : (
                <DataTable value={keyValuePairs} tableStyle={{ minWidth: '50rem' }} paginator rows={10}>
                    <Column field="code" header="Code" />
                    <Column field="name" header="Name" />
                    <Column field="category" header="Category" />
                    <Column field="quantity" header="Quantity" />
                </DataTable>
            )}
        </div>
    );
}
